import React from "react";
import { Grid, Typography } from "@material-ui/core";

export default function ContactComponent() {
  return (
    <>
      <Grid container>
        <Grid item>
          <Typography variant="h2">Axel Web design</Typography>
        </Grid>
        <Grid item>
          <Typography variant="h4">Axel Front End</Typography>
        </Grid>
      </Grid>
    </>
  );
}
